import React, { useState, useEffect } from 'react';
import logo from './logo.svg';
import './App.css';
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';

class App extends React.Component {

  constructor(props){
    super(props);
    this.state = {currentTime: 0}
  }

  componentDidMount(){
    fetch('/time').then(res => res.json()).then(data => {

      this.setState({currentTime: data.time})
      console.log(this.state.currentTime);
    });
  }

  render(){

    return(
    <div className="App">
        <header className="App-header">
        <Stack direction="row" spacing={2}>
      <Button variant="contained" style = {{position: "absolute", top: '10vw', left: '30vw'}}>Gallery</Button>
      <Button variant="contained" style = {{position: "absolute", top: '10vw', left: '50vw'}} href="#contained-buttons">
        CAMERA
      </Button>
    </Stack>

        <p>The current time is {this.state.currentTime}.</p>
      </header>
    </div>
    )
  }

}



export default App;
